import {useContext, useEffect} from 'react'
import Container from 'react-bootstrap/Container'
import Navbar from 'react-bootstrap/Navbar'
import './Header.css'
const Header = () => {
    return (
        <Container className='appHeader m-0 mw-100 d-flex align-items-center'>
            <p className='w-25 m-0 pUsuario'>Hola <span className='spanUsuario'>Sebastian</span></p>
            <Navbar className='p-0 d-flex justify-content-end w-75 align-items-center'>
                <Navbar.Brand href="!#">CERRAR SESION</Navbar.Brand>
            </Navbar>
        </Container>
    );
}
 
export default Header
